		$('.btn-burger--small').on('click', function() {
		
		  var $nav = $('.btn-burger--small');
             if ($nav.hasClass("active")) {
                 $nav[0].setAttribute('title','Show navigation');
             }
             else 
             {
                 $nav[0].setAttribute('title','Hide navigation');
             }
                         
			$(this).closest('.sidebar').find('.sidebar__body').slideUp()

			if($('.container').hasClass('closed')) {
				$('.container').removeClass('closed')
				setTimeout(function(){
					$('.sidebar .sidebar__body').slideDown()
				}, 100)

				return;
			}

			setTimeout(function(){
				$('.container').toggleClass('closed')
			}, 100)
		})


		/*//Custom ScrollBar

		/\**
		 * Filter designers
		 *\/*/
		$('.search-primary .search__field').on('keyup', function() {
			var $this = $(this);
			var val = $this.val();
			var $listName = $('.results');

			if (val && val.length > 0) {
				$listName.addClass('filtered');

				$listName.find('a').each(function() {
					var $link = $(this);
					var text = $link.text();

					if (text.toLowerCase().indexOf(val) >= 0) {
						$link.closest('li').addClass('filtered');

						$link
							.closest('ul')
							.closest('li')
							.addClass(visibleClass);
					} else {
						$link.closest('li').removeClass('filtered');
					}
				});
			} else {
				$listName.removeClass('filtered');
				$this.children('li').removeClass(visibleClass);
				$this.closest('li').removeClass('filtered');
			}
		});

		var active = 'active';
		var accordionSection = '.accordion__section';
		var accordionHead = '.accordion__head';
		var accordionBody = '.accordion__body';

		$('.accordion__head').on('click', function() {
			var $this = $(this);

			$this.toggleClass(active)
				.closest(accordionSection).toggleClass(active).siblings().removeClass(active).find(accordionHead).removeClass(active);

			$this.siblings(accordionBody).slideToggle()
				.closest(accordionSection).siblings().find(accordionBody).slideUp();
				
			$this.siblings(accordionBody).toggleClass('in');
			$this.closest(accordionSection).siblings().find('.in').removeClass('in');
		});

		//Close when click outside
		$doc.on('click touchstart', function(event) {
		    if( !$(event.target) === '.btn-burger, .sidebar' || !$(event.target).closest('.btn-burger, .sidebar').length ) {
		    	$('.btn-burger').removeClass('active');
		    	$('.sidebar').removeClass('active');
		    }
		});
		
