suitehelp.highlight = function () {
    "use strict";

    //Split out words and phrases ( series of words surrounded by quotes")
    var terms,
        term,
        termsOnly,
        searchInput = $("#search_textbox").val(),
        $article = $("article");

    if (searchInput !== "") {
        if (suitehelp.checkSearch) {
            termsOnly = searchInput.replace(/\s(NOT|AND|OR|NEAR|NEAR\/\d+)\s/g, " ");
            //splits words by spaces but will not split up a section in quotes
            terms = termsOnly.toLowerCase().replace(/^\s+|\s+$/g, '').match(/([^"\s]+)|("([^"]+)")/g);
        } else {
            terms = searchInput.toLowerCase().replace(/^\s+|\s+$/g, '').split(" ");
        }
        // Remove highlighting of the terms   
        suitehelp.unhighlight();
        if (terms) {
            // sort list of terms by length
            terms.sort(function(a, b){return a.length - b.length});
            while (terms.length) {
                term = terms.pop();
                // sanitize any special regex characters
                // term = term.replace(/([\[\\\^\$\.\|\?\*\+\(\)])/g, "\\$1"); Mantis 10108
                //remove leading and trailing quotes
                term = term.replace(/^"/g, "").replace(/"$/g, "");
                // if term is <= 3 chars, it is assumed that the search term is an entire word and larger words containing
                //      the substring should not be highlighted
                // this is only true if the term does not include wildcards, which by definition mean the the term is not a complete word
                if (term.length <= 3 && term.indexOf("*") < 0) {
                    $article.highlight(term, { wordsOnly: true, className: 'search_term' });
                } else {
                    // if term contains stars remove them
                    term = term.replace(/\*$/g, "");
                    $article.highlight(term, { className: 'search_term' });
                }
            }
        }
    }
};

