// Given a base URL, convert all links in the given HTML to be absolute.
suitehelp.makeAbsoluteURLs = function (url, html) {
    "use strict";

    url = url || "";
    html = html || "";

    //(/#.*$/, ''): Replace all anchor logic. 
    //Ex: file:///C:/MainDevelopment/SuiteHelpDitaOt/out/10_23/suite/taskbook-homepage.html#taskbook/installing.html
    //(\/[^\/]+$):  Isolate the path by removing the page reference.
    //Ex: THIS: file:///C:/MainDevelopment/SuiteHelpDitaOt/out/10_23/suite/taskbook-homepage.html?context=15
    //BECOMES:  file:///C:/MainDevelopment/SuiteHelpDitaOt/out/10_23/suite
    var relPath = url.replace(/#.*$/, '').replace(/\/[^\/]+$/, '/');

    // Set absolute URLs to something else
    //<a href="http://www.suite.com
    html = html.replace(/(<[^>]*\bsrc)(="[^"]+:)/ig, "$1abs$2");
    html = html.replace(/(<[^>]*\bhref)(="[^"]+:)/ig, "$1abs$2");
    //<a href="/www.suite.com/
    html = html.replace(/(<[^>]*\bsrc)(="\/)/ig, "$1abs$2");
    html = html.replace(/(<[^>]*\bhref)(="\/)/ig, "$1abs$2");
    //<a href="" Blank url
    html = html.replace(/(<[^>]*\bhref)(="\s*")/ig, "$1abs$2");

    // Set URLs with data-scope="external" or data-scope="peer" to something else
    html = html.replace(/(<[^>]*\bdata-scope="(external|peer)"[^>]* \bhref)(=")/ig, "$1scope$3");
    
    //Set URLs solely to anchors to something else so they are excluded from the following lines
    html = html.replace(/(<[^>]*)(\bhref)(=["']#)/ig, "$1 hreftemp$3");
    
    // Fix the URLs
    html = html.replace(/(<[^>]*)(\bsrc=")([^"]\/)?/ig, "$1$2" + relPath);
    html = html.replace(/(<[^>]*)(\bhref=["'])([^"']\/)?/ig, "$1 data-suitehelp-page='internal' $2" + relPath);
    
    //Restore URLS temporarily set to something else
    html = html.replace(/(<[^>]*)(\bhreftemp)(=)/ig, "$1 href$3");

    // Fix the URLS with the scope attribute set to "external" and "peer" but do not add data-suitehelp-page attribute to the link
    html = html.replace(/(<[^>]*)(\bhrefscope=["'])([^"']\/)?/ig, "$1 $2" + relPath);

    // Replace the absolute URLs
    html = html.replace(/srcabs=/ig, "src=");
    html = html.replace(/hrefabs=/ig, "href=");
    html = html.replace(/hrefscope=/ig, "href=");

    return html;
};

