// Set up Ajax
suitehelp.setupHistory = function () {
    "use strict";

    var History = window.History,
        /* Application Specific Variables */
        $content = $("article"),
        /* Application Generic Variables */
        $body = $(document.body);
    // Ensure Content
    if ($content.length === 0) {
        $content = $body;
    }

    // Internal Helper
    $.expr[':'].internal = function (obj) {
        // Prepare
        var
            $this = $(obj),
            isInternalLink;

        // Check link
        //mailto:suitesol.com
        isInternalLink = $this.attr("data-suitehelp-page") === "internal";
        // Ignore or Keep
        return isInternalLink;
    };

    // HTML Helper
    function documentHtml(html) {
        return String(html)
            .replace(/<\!DOCTYPE[^>]*>/i, '')
            .replace(/<(html|head|body|title|meta|article)/gi, ' <div class="document-$1"')
            .replace(/<\/(html|head|body|title|meta|article)/gi, ' </div');
    }

    // Ajaxify Helper
    $.fn.ajaxify = function () {
        //ajaxload calls ajaxify() on content.html.  Each time ajaxify is called another
        //click event is added to the selector.  This increases the click events that get 
        //fired by one each time we load an article.  We need to unbind() and remove the 
        //previous click events before we add new ones.  
       // $(this).off("click", 'a:internal');
        // Ajaxify
        //$this will be the article or body.  We changed from document to $this.  
        $(this).on("click", 'a:internal', function (event) {
            // Prepare
            var
                $this = $(this),
                url = $this.attr('href'),
                title = $this.attr('title') || null,
                id = $this.parent().attr('id'),
                destinationHash,
                destinationUrl,
                currentUrl,
                currentHash;
            // Clear out the search box when clicking on a link that is not in the search pane.  
            // we need to comment this out be cause our new engine does not base on id to return data
            // if ((id === undefined) || (id.search('^search-') === -1)) {
            //     $("#search_textbox").val("");
            // }
            // External links break everything below, get rid of them
            if ($this.attr("target")) {
                return true;
            }
            // Continue as normal for cmd clicks etc
            if (event.which === 2 || event.metaKey) {
                return true;
            }
            //IE9 example: file:///C:/inetpub/wwwroot/suitehelp/topics/topic_1.html?scroll=topic_6_7_9_unique_1#../topics/topic_6_7.html?scroll=topic_6_7_9_unique_1
            if (url.match(/#/) !== null) {
                destinationHash = String(url).replace(/([^#]*)#?([^#]*)#?(.*)/, '$2');
                destinationUrl = String(url).replace(/([^#]*)#?([^#]*)#?(.*)/, '$1');
                currentUrl = String(window.location.href).replace(/([^#|\?]*)#?([^#]*)#?(.*)/, '$1');
                currentHash = (window.location.hash).slice((window.location.hash).indexOf('#') + 1);
                if (currentHash.match(/\?/) !== null) {
                    currentHash = currentHash.slice(0, currentHash.indexOf('?'));
                }
                //Google Chrome
                if (currentUrl === destinationUrl) {
                    $("#" + destinationHash)[0].scrollIntoView();
                    return false;
                }
                //IE
                currentUrl = History.getBaseUrl(window.location.href) + currentHash;
                if (currentUrl === destinationUrl) {
                    $("#" + destinationHash)[0].scrollIntoView();
                    return false;
                }
                url = destinationUrl + "?scroll=" + destinationHash;
            }
            // Ajaxify this link
            try {
                History.pushState(null, title, url);
            } catch (e) {
                // The pushState can fail if the browser's security policy
                // disallows it.
                suitehelp.nonAjaxRedirect(url);
            }
            event.preventDefault();

            // This blur (and a few that follow) get rid of the dotted outlines
            // in FF. We do not disable this at the CSS level since the
            // outlines are an accessibility feature for keyboard users.
            $this.blur();

            return false;
        });

        // Chain
        return $(this);
    };

    // Ajaxify our Internal Links
    $body.ajaxify();

    // Hook into State Changes
    $(window).bind('statechange', function () {
        // Prepare Variables
        var
            State = History.getState(),
            url = State.url;

        // Set Loading
        $body.addClass('loading');

        // Ajax Request the Traditional Page
        function ajaxLoad() {
            if (suitehelp.addAnalytics !== undefined) {
                suitehelp.addAnalytics(url);
            }
            $.ajax({
                url: url,
                success: function (data) {
                    // Replace all relative URLs with absolute URLs
                    data = suitehelp.makeAbsoluteURLs(url, data);

                    // Prepare
                    var
                        $data = $(documentHtml(data)),
                        $dataBody = $data.find("div.document-body"),
                        $article = $data.find("div.document-article"),
                        contentHtml,
                        $metaRedirect = $data.find("div.document-meta").attr("name") !== undefined ? $data.find("div.document-meta").attr("name") : "",
                        $queryString = document.location.search !== undefined ? document.location.search : "",
                        printHref = $data.find("link[media='print']").attr("href"),
                        prevHref = $data.find("link[rel='prev']").attr("href"),
                        nextHref = $data.find("link[rel='next']").attr("href"),
                        redirectUrl,
                        selAudience;
                    if ($metaRedirect === "redirectUrl") {
                        redirectUrl =  $dataBody.find("a").attr("href") + $queryString;
                        if (redirectUrl !== undefined) {
                            url = redirectUrl;
                            History.replaceState(null, null, url);
                            ajaxLoad();
                            return;
                        }
                    }
                    // Fetch the content
                    contentHtml = $article.html();
                    // Update the content
                    //Stop the currently-running animation on the matched elements.
                    $content.stop(true, true);
                    $content.html(contentHtml).ajaxify().show(); /* you could fade in here if you'd like */

                    if (suitehelp.styleArticle !== undefined) {
                        suitehelp.styleArticle();
                    }
                    // Set the document title
                    document.title = $data.find("div.document-title:first").text();


                    // Reset the printlink for IE10 and IE11 issue
                    $(document.head).find("link[media='print']").attr("href", printHref);
                    $(document.head).find("link[rel='prev']").attr("href", prevHref);
                    $(document.head).find("link[rel='next']").attr("href", nextHref);
                    $(document.body).attr("data-relpath", $dataBody.attr("data-relpath"));

                    // Complete the change
                    $body.removeClass('loading');
                    if (suitehelp.audience) {
                        //get ?selAudience= and then the actual value
                        //&_suid=188 is added during previous and next click on IE.  
                        selAudience = String((window.location.href).match(/\?selAudience=[^#\?\&]*/)).match(/\=(.*)/);
                        if (selAudience !== null) {
                            $("#audience_selector").val(selAudience[1]);
                            suitehelp.changeAudience(false);
                        } else {
                            suitehelp.changeAudience(false);
                        }
                    }
                    // Update TOC, breadcrumbs, etc
                    suitehelp.currid = $dataBody.attr("id");
                    $("#header_Breadcrumbs").remove();
                    suitehelp.breadcrumbs();
                    suitehelp.setUpPrevAndNextButtons();
//                    suitehelp.scrollToCurrent(suitehelp.getCurrentPane().attr("id").match("^[^_]*")[0]);

                    // Highlight search terms
                    var searchInput = sessionStorage.getItem("searchInput");
                    suiteSearch.highlight(searchInput);
                    sessionStorage.removeItem("searchInput");

                    
                    //suitehelp.checkScroll();
                },
                error: function () {
                    return suitehelp.nonAjaxRedirect(url);
                }
            }); // end ajax
        }

        suitehelp.checkAjax(ajaxLoad,
            function () {
                suitehelp.nonAjaxRedirect(url);
            });

    }); // end onStateChange
};

//Make an AJAX call to get index information when the web page requests it
suitehelp.setupIndex = function () {
    "use strict";

    if (suitehelp.showIndex) {
        if ($("#index_nav").length) {
            //Read in index
            if (!suitehelp.synchronousJS) {
                var urlIndex = $("body").attr("data-approot") +  'static/index.js';
                $.ajax({
                    url: urlIndex,
                    dataType: 'script',
                    cache: true, // otherwise will get fresh copy every page load
                    success: function () {suitehelp.loadIndex(); }
                });
            } else {
                suitehelp.loadIndex();
            }
        }
    }
};

//Create the Table of Contents
suitehelp.setupLeftBar = function () {
    "use strict";

    // To make pages smaller, the TOC, index and glossary are stored in JavaScript.
    // Pull in that content now.
    suitehelp.addContent("toc_nav", suitehelp.toc.toc);

    suitehelp.addContent("glossary_nav", suitehelp.leftbarContent.glossary);

    suitehelp.setupTocBranches();

    // Hide index and glossary tabs if their content is empty
    function hideTab(name) {
        $("#" + name).hide();
    }

    hideTab("index_container");
    if (!$("#glossary_nav li").length) {
        hideTab("glossary_container");
    }
};

//Make an AJAX call to get the underlying trees of the Table of Contents.
suitehelp.setupTocBranches = function () {
    "use strict";

    if (!suitehelp.synchronousJS) {
        var secondSearch = $("body").attr("data-approot") + 'static/tocbranches.js';
        $.ajax({
            url: secondSearch,
            dataType: 'script',
            cache: true, // otherwise will get fresh copy every page load
            success: function () { suitehelp.loadTocBranches(); }
        });
    } else {
        suitehelp.loadTocBranches();
    }
};

suitehelp.setUpPrevAndNextButtons = function () {
    "use strict";

    $("#button_back, #button_forward, #button_back_mobile, #button_forward_mobile").removeClass("disabled");

    if ($("link[rel='prev']").attr("href") === $("link[rel='next']").attr("href")) {
        $("#button_forward, #button_back, #button_back_mobile, #button_forward_mobile").addClass("disabled");
    }

    if (suitehelp.disablePrevAndNextButtons) {
        if ((suitehelp.tocArray[0] === suitehelp.currid) || $("body[data-relpath$='-homepage.html']").length === 1) {
            $("#button_back").addClass("disabled");
            $("#button_back_mobile").addClass("disabled");
        }
        if (suitehelp.tocArray[suitehelp.tocArray.length - 1] === suitehelp.currid) {
            $("#button_forward").addClass("disabled");
            $("#button_forward_mobile").addClass("disabled");
        }
    }
};
// Set up the back, forward and print buttons
suitehelp.setupToolbar = function () {
    "use strict";

    suitehelp.setUpPrevAndNextButtons();

    function moveTo(i) {
        suitehelp.currid = suitehelp.tocArray[i];

        var $t = $('[id="toc-' + suitehelp.currid + '"] > a'),
            url = $t.attr("href"),
            title = $t.text();

        // Catch exceptions and redirect manually if there is an error
        // on the local filesystem.
        try {
            window.History.pushState(null, title, url);
        } catch (e) {
            document.location.href = url;
            return;
        }
    }

    $("#button_back").click(function () {
        if (!$("#button_back").hasClass("disabled")) {
            var j = (suitehelp.tocObject[suitehelp.currid] || suitehelp.tocArray.length) - 1;
            moveTo(j);
        }
        return false;
    });
    $("#button_back_mobile").click(function () {
        if (!$("#button_back_mobile").hasClass("disabled")) {
            var j = (suitehelp.tocObject[suitehelp.currid] || suitehelp.tocArray.length) - 1;
            moveTo(j);
        }
        return false;
    });
    
    $("#button_forward").click(function () {
        if (!$("#button_forward").hasClass("disabled")) {
            var k = (suitehelp.tocObject[suitehelp.currid] + 1 || 0) % suitehelp.tocArray.length;
            moveTo(k);
        }
        return false;
    });
    
        $("#button_forward_mobile").click(function () {
        if (!$("#button_forward_mobile").hasClass("disabled")) {
            var k = (suitehelp.tocObject[suitehelp.currid] + 1 || 0) % suitehelp.tocArray.length;
            moveTo(k);
        }
        return false;
    });

    $("#button_print").click(function () {
        $("#printall").detach();
        window.print();
        return false;
    });
    
    $("#button_print_mobile").click(function () {
        $("#printall").detach();
        window.print();
        return false;
    });


    $("#button_print_all").click(function () {
        $("#printall").detach();
        $("article").append("<div id='printall'/>");
        suitehelp.loadChildrenForPrintAll($('[id="toc-' + suitehelp.currid + '" ]'), $("#printall"), window.print);
        return false;
    });

    $("#button_highlighting").click(function () {
        $("body").toggleClass("no_highlighting");
        return false;
    });

   $("#button_highlighting_mobile").click(function () {
        $("body").toggleClass("no_highlighting");
        return false;
    });
//email
//Edit the e-mail button to add the pub title in the subject and the topic title and id to the e-mail body.
    $("#button_email").click(function(){
         var title = $(".topictitle1");
         var subject = 'I would like to share this topic with you'+': "'  + $(title).text()+ '"';
         var article = window.location.href;
         $(location).attr('href',"mailto:documentation@suite-sol.com"+ " " +"?subject=" +subject + "&body=" + article);
 });
 
     $("#button_email_mobile").click(function(){
         var title = $(".topictitle1");
         var subject = 'I would like to share this topic with you'+': "'  + $(title).text()+ '"';
         var article = window.location.href;
         $(location).attr('href',"mailto:documentation@suite-sol.com"+ " " +"?subject=" +subject + "&body=" + article);
 });
		

    $("#button_hide_navigation").click(function () {
        $("body").toggleClass("hide-nav");
        if ($('body[class~="hide-nav"]').length > 0) {
            $("#button_hide_navigation").attr("title", "Show navigation");
            $("#showhidenav").attr("class", "glyphicon glyphicon-resize-small");
        } else {
            $("#button_hide_navigation").attr("title", "Hide navigation");
            $("#showhidenav").attr("class", "glyphicon glyphicon-fullscreen");
        }
        return false;
    });

    $("#audience_selector").change(function () {
        suitehelp.changeAudience(true);
        return false;
    });
};

suitehelp.scrollToCurrent = function (currentNav) {
    "use strict";
    if (currentNav === "toc" || currentNav === "search") {
        if ($("#" + currentNav + "_nav li.current")[0] !== undefined) {
            $("#" + currentNav + "_nav li.current")[0].scrollIntoView();
        }
    }
};

