suitehelp.breadCrumbPos = "3";

suitehelp.closeOpenTrees = function ($currentLi) {
    "use strict";

    $("#toc_nav").find("li.open").not($currentLi.parents("li")).children("ul").slideToggle();
    $("#toc_nav").find("li.open").toggleClass("closed").toggleClass("open");
};

suitehelp.defineLeftBarEvents = function () {
    "use strict";
    
   $(".accordion__body.in").slideDown();
   $(".nav-secondary#toc_nav > nav > ul").mCustomScrollbar();
 
    $('.nav-secondary li i').on('click', function(e) {
         var $parent = $(this).parent();
         var $siblingUl = $parent.find(' > ul');
         
         if ( $siblingUl.length && !$parent.hasClass('open') ){
             $parent.addClass('open').removeClass('closed');
             $parent.find('> ul').slideDown();
         
             e.preventDefault();
         }

        else if ($siblingUl.length && $parent.hasClass('open') ){
             $parent.removeClass('open').addClass('closed');
             $parent.find('> ul').slideUp();
         
             e.preventDefault();
            }

        });
          $('.nav-secondary li a').on('click', function(e) {
         var $parent = $(this).parent();
         var $siblingUl = $parent.find(' > ul');
         
         if ( $siblingUl.length && !$parent.hasClass('open') ){
             $parent.addClass('open').removeClass('closed');
             $parent.find('> ul').slideDown();
         
             e.preventDefault();
         }
         else if ($siblingUl.length && $parent.hasClass('open') ){
             $parent.removeClass('open').addClass('closed');
             $parent.find('> ul').slideUp();
         
             e.preventDefault();
         }
        });
        
    $('.nav-secondary.toc_nav a').on('click', function(e) {  
        $('#button_back').removeClass('disabled');
        $('#button_forward').removeClass('disabled');
    });
        $('.nav-secondary li:not(.closed) a').on('click', function(e) {
            if (screen.width < 1024){
               $('.sidebar').removeClass('active');
               $('.btn-burger').removeClass('active');
              }
                           e.preventDefault();

        });
        
        if($('.nav-secondary').length) {
			$('.nav-secondary').find('.open > ul').slideDown()
		}
		        
          $('.link-expand').on('click', function(e) {
         
         if (!($('#toc_pane')).hasClass("in")) {
            $('#toc_pane').addClass('in').slideDown();	
            $('#toc_pane').closest('.accordion__section').siblings().find('.in').removeClass('in').slideUp();
            $('#toc_pane').siblings('.accordion__head').addClass('active').closest('.accordion__section').siblings().removeClass('active').find('.accordion__head').removeClass('active');
        }
        $('#toc_pane').find('.closed').removeClass('closed').addClass('open').slideDown();
        $('.open > ul').slideDown();
        });
        
        $('.link-collapse').on('click', function(e) {
         if (!($('#toc_pane')).hasClass("in")) {
            $('#toc_pane').addClass('in').slideDown();	
            $('#toc_pane').closest('.accordion__section').siblings().find('.in').removeClass('in').slideUp();
            $('#toc_pane').siblings('.accordion__head').addClass('active').closest('.accordion__section').siblings().removeClass('active').find('.accordion__head').removeClass('active');
        }
        $('#toc_pane').find('.open').removeClass('open').addClass('closed').slideDown();
        $('.closed > ul').slideUp();
        });
        
        $('body:not(ajax) .nav-secondary#index_nav li.leaf a').on('click', function(e) {
            var currID =$(this).parent().attr("id");
            sessionStorage.setItem("CurrIndex",currID);
            
   });
      
        
             
        $('body.ajax .nav-secondary#index_nav li.leaf a').on('click', function(e) {
            var currID =$(this).parent().attr("id");
            currID = document.getElementById(currID);
            if ($('.nav-secondary#index_nav li').hasClass('curr_index')) {
                $('.nav-secondary#index_nav li').removeClass('curr_index');
                }
            $(currID).addClass('curr_index');
            $('#button_back').addClass('disabled');
            $('#button_forward').addClass('disabled'); 
           
         
   });
      
        
      $('.nav-secondary:not(#search_nav) li a').on('click', function(e) {
        $("#search_textbox").val("");            });

};

suitehelp.getDialogDimensions = function (img) {
    "use strict";

    var dialogWidth, dialogHeight;
    if (($.getDocHeight() < img.naturalHeight()) && ($.getDocWidth() < img.naturalWidth())) {
        dialogWidth = $.getDocWidth() - 100;
        dialogHeight = $.getDocHeight() - 100;
    } else if (($.getDocHeight() < img.naturalHeight()) && ($.getDocWidth() > img.naturalWidth())) {
        //Very tall
        dialogWidth = img.naturalWidth() + 60;
        dialogHeight = $.getDocHeight() - 100;
    } else if (($.getDocHeight() > img.naturalHeight()) && ($.getDocWidth() < img.naturalWidth())) {
        //Very wide
        dialogWidth =  $.getDocWidth() - 100;
        dialogHeight = img.naturalHeight() + 100;
    } else {
        dialogWidth =  img.naturalWidth() + 40;
        dialogHeight =  img.naturalHeight() + 80;
    }
    return { height: dialogHeight, width: dialogWidth };
};

suitehelp.initializeBreadCrumbs = function () {
    "use strict";

    suitehelp.breadcrumbs();
  //  suitehelp.showBreadcrumbsEllipse();
};

suitehelp.resizeArticlePane = function () {
    "use strict";

    var headerHeight, toolbarHeight, breadcrumbHeight;

    headerHeight = $("#header").is(":hidden") ? 0 : $("#header").outerHeight();
    toolbarHeight = $("#toolbar").is(":hidden") ? 0 : $("#toolbar").outerHeight();
    breadcrumbHeight = $("#breadcrumbs").is(":hidden") ? 0 : $("#breadcrumbs").outerHeight();

    if ($("body").css("overflow-y") === "hidden") {
        $("article").css("max-height",  $(window).height() - (headerHeight + toolbarHeight + breadcrumbHeight + 45));
    }
};

