function hide_popup() {
     $("#feedback-modal-content").removeClass("show").addClass("hide");
};

function show_popup() {
     $("#feedback-modal-content").removeClass("hide").addClass("show");
};

function submit() {
    var lineBreak = "%0D%0A%0D%0A"; 
    var comment = $("#feedbackCommentsNewUI");
    var starsArray = $('input[type="radio"][name="stars"]:checked');
    var stars = 0;
    if(starsArray.length>0)
        stars = starsArray[0].value;
    else
    {
        $("#required-rate").addClass("visible");
        $("#rating").addClass("required");
        return;
    }
    var loc = escape($(location).attr('href').toString());
    var vars = "File: "+loc+lineBreak+"Rating: "+stars+lineBreak+"Comment: "+comment.val();

    hide_popup();
    
    //open mailto
    $(location).attr('href',"mailto:docfeedback@suite-sol.com?subject=Feedback for:%20"+loc+"&body="+vars);
    
    //clean form
    comment.val("");
    starsArray[0].checked = false;
    
};

function required() {
    $("#rating").removeClass("required")
    $("#required-rate").removeClass("visible");
};



var suiteSearch = suitehelp || {};

suiteSearch.performSearch = function (queryString) {
    "use strict";

    if (suitehelp.getQueryString("q") || suitehelp.getQueryString("local")) {
        suitehelp.checkSearch = false;
    }

    var boolCondition = 'OR';

    var originalQueryString = queryString;

    if (queryString.indexOf('+') > -1) {
        boolCondition = 'AND';
        queryString = queryString.replace(/\+/g, ' ');
    }

    var searchResults = this.searchIndex.search(queryString, {
        bool: boolCondition,
        expand: true
    });

    var quotedText = suiteSearch._helpers.extractText(queryString);
    var isExactMatch = quotedText && quotedText.length;

    searchResults = searchResults.filter(function (result) {
        var doc = result.doc;
        if (!doc) return false;

        if (isExactMatch) {
            if (!suiteSearch._helpers.exactMatch(quotedText, doc)) {
                console.log('skipping', doc.page_name);
                return false;
            }
        }
        return true;
    });
    
     // remove stopwords from queryString
     var tokens = queryString.split(" ");
     var newqueryString ="";
        tokens.forEach(function(token) {
            if (token && elasticlunr.stopWordFilter.stopWords[token] !== true){ 
                        newqueryString += " " +token;                
            } 
            queryString = newqueryString;
      });
      
    suiteSearch.showSearchResult(searchResults, queryString);
};

