suiteSearch._helpers = {
    loadScript: function loadScript(src, callback) {
        var script = document.createElement('script'),
            loaded;
        script.setAttribute('src', src);

        if (callback) {
            script.onreadystatechange = script.onload = function () {
                if (!loaded) {
                    callback();
                }
                loaded = true;
            };
        }

        document.getElementsByTagName('body')[0].appendChild(script);
        var x = document.getElementsByTagName('script')[0];
        x.parentNode.insertBefore(script, x);
    },
    extractText: function extractText(str) {
        var ret = null;

        if (/"/.test(str)) {
            var match = str.match(/"(.*?)"/);
            if (match && match.length > 1) {
                ret = match[1];
            }
        }

        return ret;
    },

    exactMatch: function exactMatch(query, doc) {
        // query = query.toLowerCase();
        // return Object.keys(doc).find(k => doc[k].toLowerCase().indexOf(query) >= 0);

        var regex = new RegExp('\(' + query + '\)\\b', 'ig');

        return Object.keys(doc).find(function (k) {
            return regex.test(doc[k]);
        });
    }
};

suiteSearch.setupSearch = function () {
    "use strict";

    // set up elastic lunr
    let languages = ['en', 'ru', 'ja', 'cn', 'de'];
    lunr.multiLanguage.apply(lunr, languages);

    this.searchIndex = lunr.Index.load(idxData);

    this.stemmers = languages.map(function (l) {
        return l === 'en' ? lunr.stemmer : lunr[l].stemmer;
    }).filter(function (s) {
        return !!s;
    });
    this.tokenizers = languages.map(function (l) {
        return l === 'en' ? lunr.tokenizer : lunr[l].tokenizer;
    }).filter(function (t) {
        return !!t;
    });

    $("#search_form").submit(function () {
        var val = $("#search_textbox").val();
        
          //search in home-page
        if ($(this).parents('#home-page').length!=0){
            var homepage = $('.toc > a').attr("href");
            window.location.replace(homepage+'?q='+val);
            sessionStorage.setItem("CurrPane","search_pane");
            sessionStorage.setItem("Origin","home");
        }
          
        
        if (suitehelp.audience) {
            $("#audience_selector").val("ALL");
            suitehelp.changeAudience(false);
        }
        suitehelp.performSearch(val);
        //alert("setupSearch");
        suitehelp.openCurrentLeftBarPane("search_pane");
       if (screen.width < 1024){
            $('#search_pane.in').closest($('.sidebar')).addClass('active');
            $('#search_pane.in').slideDown();
          }
        return false;
    });
    
 
    $(document.body).on("click", '#search_results li a', function (event) {
        // Prepare
        var
            $this = $(this),
            url = $this.attr('href'),
            id = $this.parent().attr('id'),
            destinationHash,
            destinationUrl,
            currentUrl,
            currentHash;
        // Clear out the search box when clicking on a link that is not in the search pane.
        // we need to comment this out be cause our new engine does not base on id to return data
        // if ((id === undefined) || (id.search('^search-') === -1)) {
        //     $("#search_textbox").val("");
        // }
        // External links break everything below, get rid of them
        if ($this.attr("target")) {
            return true;
        }
        // Continue as normal for cmd clicks etc
        if (event.which === 2 || event.metaKey) {
            return true;
        }
        //IE9 example: file:///C:/inetpub/wwwroot/suitehelp/topics/topic_1.html?scroll=topic_6_7_9_unique_1#../topics/topic_6_7.html?scroll=topic_6_7_9_unique_1
        if (url.match(/#/) !== null) {
            destinationHash = String(url).replace(/([^#]*)#?([^#]*)#?(.*)/, '$2');
            destinationUrl = String(url).replace(/([^#]*)#?([^#]*)#?(.*)/, '$1');
            currentUrl = String(window.location.href).replace(/([^#|\?]*)#?([^#]*)#?(.*)/, '$1');
            currentHash = (window.location.hash).slice((window.location.hash).indexOf('#') + 1);
            if (currentHash.match(/\?/) !== null) {
                currentHash = currentHash.slice(0, currentHash.indexOf('?'));
            }
            //Google Chrome
            if (currentUrl === destinationUrl) {
                $("#" + destinationHash)[0].scrollIntoView();
                return false;
            }
            //IE
            currentUrl = History.getBaseUrl(window.location.href) + currentHash;
            if (currentUrl === destinationUrl) {
                $("#" + destinationHash)[0].scrollIntoView();
                return false;
            }
            url = destinationUrl + "?scroll=" + destinationHash;
        }
        
                    // Highlight search terms
  //    var searchInput = $("#search_textbox").val();
        sessionStorage.setItem("searchInput",$("#search_textbox").val());
       
      
           if (screen.width < 1024){
               $('.sidebar').removeClass('active');
               $('.btn-burger').removeClass('active');
              }

        event.preventDefault();

        // This blur (and a few that follow) get rid of the dotted outlines
        // in FF. We do not disable this at the CSS level since the
        // outlines are an accessibility feature for keyboard users.
        $this.blur();

        return false;
    });


};

